description:
This is the latest Darkstorm Viewer at the moment (March 2013).
You can export/import prim objects however Mesh (HPA) exports are restricted.
To enable that you must have a hardware key which is only obtainable by paying for a membership at king goon or building cred in the forum by providing xml's or uuid's for copied content.
